import * as React from 'react';
import { useReducer } from 'react';

const initialState = {
  count: 0,
};

const reducer = (state: any, action: any) => {
  if (action === 'INCREMENT') {
    return { count: state.count + 1 };
  } else {
    return { count: state.count - 1 };
  }
};

const Test: React.FC = () => {
  const [state, dispatch] = useReducer(reducer, initialState);

  return (
    <>
      <div>てすと</div>
      <h1>Counter</h1>
      <h2>カウント: {state.count}</h2>
      <button>+</button>
      <button>-</button>
    </>
  );
};

export default Test;
